	this.frame_1201 = function() {
		this.stop();
		
		var soundsLoaded = 0;
		var requiredSounds = 4; // wish, iskviepk1, shelest, snabzdantis
		
		function checkSounds() {
		    soundsLoaded++;
		    if (soundsLoaded === requiredSounds) {
		        initScene.call(this);
		        console.log("Visi audio ikelti");
		    }
		}
		
		createjs.Sound.addEventListener("fileload", checkSounds.bind(this));
		
		createjs.Sound.registerSound("sounds/wish.mp3", "wish");
		createjs.Sound.registerSound("sounds/iskviepk1.mp3", "iskviepk1");
		createjs.Sound.registerSound("sounds/shelest.mp3", "shelest");
		createjs.Sound.registerSound("sounds/snabzdantis.mp3", "snabzdantis");
		
		function initScene() {
		    const root = this;
		
		    if (!root.spausk1_btn) console.error("spausk1_btn nerastas!");
		    if (!root.LejaBig1) console.error("LejaBig1 nerasta!");
		
		    if (!root.spausk1_btn || !root.LejaBig1) return;
		
		    root.spausk1_btn.visible = false;
		    root.toliau_btn.visible = false;
		
		    root.LejaBig1.gotoAndStop(1);
		
		    var startClicked = false;
		
		    root.stage.on("stagemousedown", () => {
		        if (startClicked) return;
		        startClicked = true;
		
		        console.log("Scenos pradzia: gruoja iskviepk1");
		
		        var sound1 = createjs.Sound.play("iskviepk1");
		
		        sound1.on("complete", () => {
		            root.spausk1_btn.visible = true;
		            root.spausk1_btn.cursor = "pointer";
		
		            root.spausk1_btn.on("click", () => {
		                console.log("spausk1_btn paspausta!");
		                root.spausk1_btn.visible = false;
		
		                root.LejaBig1.gotoAndPlay("outside");
		                createjs.Sound.play("wish");
		
		                for (var i = 0; i < root.numChildren; i++) {
		                    var child = root.getChildAt(i);
		                    if (child.name && child.name.startsWith("leaves")) {
		                        child.gotoAndPlay("falling");
		                    }
		                }
		
		                var sound2 = createjs.Sound.play("shelest");
		                sound2.on("complete", () => {
		                    var sound3 = createjs.Sound.play("snabzdantis");
		                    sound3.on("complete", () => {
		                        root.toliau_btn.visible = true;
		                    });
		                });
		            });
		        });
		    });
		
		    root.toliau_btn.on("click", () => {
		        root.gotoAndPlay(1202);
		    });
		
		    console.log("Elementu patikra:", {
		        spausk1_btn: root.spausk1_btn != null,
		        LejaBig1: root.LejaBig1 != null,
		        toliau_btn: root.toliau_btn != null
		    });
		}
	}
